import Item from "./Item";
import React from "react";
import { Col, Row } from "react-bootstrap";

const ItemList = (data) => {
    console.log("Estos son los productos", data.productos)
    const laRopa = data.productos

    return (
        <Row>
            <Col md="3" mb="2">
                <div>
                    {laRopa.map((prenda) => (
                        <div>
                            <p> {prenda.nombre}</p>
                            <img
                                className="remera"
                                src={prenda.imagen}
                            />
                            <p> {prenda.precio}</p>
                        </div>
                    )
                    )}
                </div>
            </Col>
        </Row>
    )

}
export default ItemList;
